import React from 'react'
import axios from "axios";
import { useSelector, useDispatch } from "react-redux";
import { actionscategories } from '../../redux/actions/actionsCategories';


export default function TrainingCompass() {

const dispatch = useDispatch();


const onSelectCategory = () => {
  axios.get('http://127.0.0.1:8000/')
  .then(response =>{
    // console.log(response)
    dispatch(actionscategories(response.data.title))
  })
  .catch(error =>{console.log(error)})
}



  return (
    <div className="content">
    <div className="category-block">
      <div className="block-category">
        <div className="category-text">
          <div onClick={onSelectCategory} className="name-category">1</div>
          <div className="name-category">2</div>
          <div className="name-category">3</div>
          <div className="name-category">4</div>
          <div className="name-category">5</div>
          <div className="name-category">6</div>
        </div>
      </div>
    </div>
    <div className="block-program">
      <div className="block-category">
        <div className="block-question">
          <div className="question-name">question-name</div>
          <div className="response-name">
            <div className="answer-button">ВОПРОС</div>
            <div className="answer-button">NEXT</div>
          </div>
        </div>
      </div>
    </div>
  </div>
  )
}
